- input: "TEXT\x1CC00478438\x1C.TEXT\x1C\x1CF3A\x1CREGARDING LETTER DATED JUNE 15,
    2010.  CONCERN #1 WAS THE DISCREPANCIES BETWEEN COLUMN A AND B IN THE REPORT.
    \ AS IT TURNS OUT WITH THE HELP OF FEC STAFF THE PROBLEM WAS IN MY UNFAMILARITY
    WITH THE SOFTWARE AND I HAD ENTERED THE WRONG DATES FOR THE ELECTION CYCLE.  CORRECT
    DATES CORRECTED THE PROBLEM.  CONCERN # 2 STATED THAT THE COMMISSION REQUIRES
    FULL NAMES WITH NO INITIALS WHEN REPORTING CONTRIBUTORS AS STATED IN 11 CFR SS.
    104.3(a)(4)(i) AND 11 CFR SS. 100.12.  THE FIRST CITATION DOESN'T APPLY BECAUSE
    IT CONCERNS ONLY DISPERSALS.  THE SECOND CITATION WOULD APPLY EXCEPT THAT IT REQUIRES
    ONLY MIDDLE NAMES IF THE TREASURER HAS THEM AVAILABLE.  THERE WAS ALSO A NOTATION
    THAT SOME OCCUPATIONS AND EMPLOYERS FOR CONTRIBUTORS WERE MISSING.  THOSE HAVE
    BEEN ACQUIRED AND ARE REPORTED.  IN VIEW OF THE TIME CONTRAINTS IMPOSED BY THE
    LETTER I RESEARCHED THE INDIVDUALS ON THE INTERNET AND IN SOME CASES AFTER THREE
    PHONE CALLS ACQUIRED THE REQUESTED INFORMATION.  I BELIEVE THIS SHOULD ANSWER
    ALL THE FEC CONCERNS.\n"
